import './App.css';

import HomePage from "./HomePage";
import Layout from "./pages/Layout";
import NoPage from "./pages/NoPage";
import SdgPage from "./pages/sdgButton"
import KanPage from "./pages/kanPage"
import ChiPage from "./pages/NFC/North/chiPage"

import Homepage from "./HomePage";

import { BrowserRouter, Routes, Route } from "react-router-dom";


function App() {

  return (
  	<>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<HomePage />} />

          //NFC NORTH
          <Route path="chi" element={<ChiPage />} />
          <Route path="gnb" element={<ChiPage />} />
          <Route path="det" element={<ChiPage />} />
          <Route path="min" element={<ChiPage />} />

          <Route path="sdg" element={<SdgPage />} />
          <Route path="kan" element={<KanPage />} />

          <Route path="*" element={<NoPage />} />
        </Route>
      </Routes>
    </BrowserRouter>
  	</>
  );
  }

export default App;
